(function() {
  const fontsToCheck = [
    "Inter",
    "Inter Tight",
  ];

  // Helper function to check if all fonts are loaded
  function areFontsLoaded(fonts) {
    return Promise.all(
      fonts.map(font => {
        return document.fonts.load(`1em ${font}`).then(loadedFonts => {
          return loadedFonts.length > 0;
        });
      })
    ).then(results => results.every(Boolean));
  }

  // Check and add class if all fonts are loaded
  areFontsLoaded(fontsToCheck).then(allLoaded => {
    if (allLoaded) {
      document.documentElement.classList.add("fonts-loaded");
    } else {
      console.warn("Not all fonts loaded successfully.");
    }
  });
})();
